module aes_cipher_top (
   // Outputs
   done, text_out,
   // Inputs
   clk, rst, ld, key, text_in
   ) ;
   input          clk, rst;
   input          ld;
   input  [127:0] key;
   input  [127:0] text_in;
   output         done;
   output [127:0] text_out;
   // Beginning of automatic regs (for this module's undeclared outputs)
   reg			done;
   reg	[127:0]	text_out;
   // End of automatics
   reg	[127:0]	text_in_r;
   reg	[7:0]	sa[0:3][0:3];
   reg	[3:0]	dcnt;
   reg		ld_r;
   // State machine
   localparam IDLE = 4'b0000;
   localparam INIT_ROUND = 4'b0001;
   localparam ROUND_OP = 4'b0010;
   localparam FINAL_ROUND = 4'b0011;
   localparam DONE = 4'b0100;
   reg [3:0] state;
   always @(posedge clk) begin
      if (rst) begin
	 state <= IDLE;
	 done <= 0;
	 text_out <= 0;
	 dcnt <= 0;
	 ld_r <= 0;
      end
      else begin
	 case (state)
	   IDLE: begin
	      done <= 0;
	      text_out <= 0;
	      dcnt <= 0;
	      if (ld) begin
		 state <= INIT_ROUND;
		 ld_r <= 1;
	      end
	   end
	   INIT_ROUND: begin
	      state <= ROUND_OP;
	      text_in_r <= text_in;
	      sa[0][0] <= text_in_r[127:120];
	      sa[0][1] <= text_in_r[119:112];
	      sa[0][2] <= text_in_r[111:104];
	      sa[0][3] <= text_in_r[103:96];
	      sa[1][0] <= text_in_r[95:88];
	      sa[1][1] <= text_in_r[87:80];
	      sa[1][2] <= text_in_r[79:72];
	      sa[1][3] <= text_in_r[71:64];
	      sa[2][0] <= text_in_r[63:56];
	      sa[2][1] <= text_in_r[55:48];
	      sa[2][2] <= text_in_r[47:40];
	      sa[2][3] <= text_in_r[39:32];
	      sa[3][0] <= text_in_r[31:24];
	      sa[3][1] <= text_in_r[23:16];
	      sa[3][2] <= text_in_r[15:8];
	      sa[3][3] <= text_in_r[7:0];
	      dcnt <= 11;
	   end
	   ROUND_OP: begin
	      if (dcnt == 10) begin
		 state <= FINAL_ROUND;
	      end
	      else begin
		 state <= ROUND_OP;
		 dcnt <= dcnt - 1;
	      end
	   end
	   FINAL_ROUND: begin
	      state <= DONE;
	   end
	   DONE: begin
	      done <= 1;
	      text_out[127:120] <= sa[0][0];
	      text_out[119:112] <= sa[0][1];
	      text_out[111:104] <= sa[0][2];
	      text_out[103:96] <= sa[0][3];
	      text_out[95:88] <= sa[1][0];
	      text_out[87:80] <= sa[1][1];
	      text_out[79:72] <= sa[1][2];
	      text_out[71:64] <= sa[1][3];
	      text_out[63:56] <= sa[2][0];
	      text_out[55:48] <= sa[2][1];
	      text_out[47:40] <= sa[2][2];
	      text_out[39:32] <= sa[2][3];
	      text_out[31:24] <= sa[3][0];
	      text_out[23:16] <= sa[3][1];
	      text_out[15:8] <= sa[3][2];
	      text_out[7:0] <= sa[3][3];
	   end
	 endcase // case (state)
	 if (ld_r) ld_r <= 0;
      end // else: !if(rst)
   end // always @ (posedge clk)
endmodule

