//------------------------------------------------------------------------------
// Module 'aes_inv_cipher_top'
//------------------------------------------------------------------------------
module aes_inv_cipher_top(
   // Outputs
   done, text_out,
   // Inputs
   clk, rst, kld, ld, text_in, key
   ) ;
   input           clk;
   input           rst;
   input           kld;
   input           ld;
   input [127:0]   text_in;
   input [127:0]   key;
   output          done;
   output [127:0]  text_out;
   // Beginning of automatic regs (for this module's undeclared outputs)
   reg			done;
   reg [127:0]	text_out;
   // End of automatics
   // Registers declaration
   reg [127:0]     text_in_r;
   reg [7:0]       sa[0:3][0:3];
   reg [3:0]       dcnt;
   reg [127:0]     kb[10:0];
   reg [3:0]       kcnt;
   reg             ld_r;
   // Wires declaration
   wire            go;
   // Behaviour
   // FSM
   //--------------------------------------------------------------------
   // FSM : IDLE
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       dcnt <= #1 4'h0;
     else if (kld)
       dcnt <= #1 4'h1;
     else if (ld)
       dcnt <= #1 4'h1;
     else if (go)
       dcnt <= #1 dcnt + 1;
   //--------------------------------------------------------------------
   // FSM : KeyLoad
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       kcnt <= #1 4'ha;
     else if (kld)
       kcnt <= #1 4'h9;
     else if (kcnt != 4'h0)
       kcnt <= #1 kcnt - 1;
   //--------------------------------------------------------------------
   // FSM : KeyExpansion
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       ld_r <= #1 1'b0;
     else if (kld)
       ld_r <= #1 1'b1;
     else if (kcnt == 4'h0)
       ld_r <= #1 1'b0;
   //--------------------------------------------------------------------
   // FSM : KeyStored
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       done <= #1 1'b0;
     else if (dcnt == 4'hb)
       done <= #1 1'b1;
     else if (dcnt == 4'ha)
       done <= #1 1'b0;
   //--------------------------------------------------------------------
   // FSM : go
   //--------------------------------------------------------------------
   assign go = (dcnt != 4'ha) && (dcnt != 4'hb);
   //--------------------------------------------------------------------
   // FSM : Done
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       text_out <= #1 128'h0;
     else if (done)
       text_out <= #1 text_in_r;
   //--------------------------------------------------------------------
   // FSM : InitialRound
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       text_in_r <= #1 128'h0;
     else if (ld)
       text_in_r <= #1 text_in;
     else if (ld_r)
       text_in_r <= #1 text_in_r ^ kb[dcnt];
   //--------------------------------------------------------------------
   // FSM : StandardRound
   //--------------------------------------------------------------------
   always @(posedge clk or posedge rst)
     if (rst)
       sa[0][0] <= #1 8'h0;
     else if (ld_r)
       sa[0][0] <= #1 text_in_r ^ kb[dcnt];
     else if (go)
       sa[0][0] <= #1 sa[0][0] ^ kb[dcnt];
   always @(posedge clk or posedge rst)
     if (rst)
       sa[0][1] <= #1 8'h0;
     else if (ld_r)
       sa[0][1] <= #1 sa[1][0];
     else if (go)
       sa[0][1] <= #1 sa[0][1] ^ kb[dcnt];
   always @(posedge clk or posedge rst)
     if (rst)
       sa[0][2] <= #1 8'h0;
     else if (ld_r)
       sa[0][2] <= #1 sa[2][0];
     else if (go)
       sa[0][2] <= #1 sa[0][2] ^ kb[dcnt];
   always @(posedge clk or posedge rst)
     if (rst)
       sa[0][3] <= #1 8'h0;
     else if (ld_r)
       sa[0][3] <= #1 sa[3][0];
     else if (go)
       sa[0][3] <= #1 sa[0][3] ^ kb[dcnt];
   always @(posedge clk or posedge rst)
     if (rst)
       sa[1][0] <= #1 8'h0;
     else if (ld_r)
       sa[1][0] <= #1 sa[0][1];
     else if (go)
       sa[1][0] <= #1 sa[1][0] ^ kb[dcnt];
   always @(posedge clk or posedge rst)
     if (rst)
       sa[1][1] <= #1 8'h0;
     else if (ld_r)
       sa[1][1] <= #1 sa[1][1];
     else if (go)
