    //
    // Key Expansion Buffer
    //
    //
    // Buffer Control Logic
    //
    always @(posedge clk or posedge rst)
        if (rst)
            kcnt <= 4'ha;
        else if (kld)
            kcnt <= 4'h0;
        else if (kcnt!=4'h0)
            kcnt <= kcnt - 1;
    wire kb_ld = (kcnt!=4'h0);
    //
    // Key Storage Process
    //
    always @(posedge clk)
        if (kld)
        begin
            kb[10] <= w3;
            kb[9] <= w2;
            kb[8] <= w1;
            kb[7] <= w0;
            kb[6] <= w3;
            kb[5] <= w2;
            kb[4] <= w1;
            kb[3] <= w0;
            kb[2] <= w3;
            kb[1] <= w2;
            kb[0] <= w1;
        end
        else if (kb_ld)
        begin
            kb[10] <= kb[9];
            kb[9] <= kb[8];
            kb[8] <= kb[7];
            kb[7] <= kb[6];
            kb[6] <= kb[5];
            kb[5] <= kb[4];
            kb[4] <= kb[3];
            kb[3] <= kb[2];
            kb[2] <= kb[1];
            kb[1] <= kb[0];
