    // Key Retrieval Mechanism
    //
    wire [127:0] w3, w2, w1, w0;
    assign w3 = kb[dcnt+3];
    assign w2 = kb[dcnt+2];
    assign w1 = kb[dcnt+1];
    assign w0 = kb[dcnt];
