    // Multiplication functions in GF(2^8)
    //
    function [7:0] pmul_e;
        input [7:0] x;
        begin
            if (x[7])
                pmul_e = (x << 1) ^ 8'h1b;
            else
                pmul_e = x << 1;
        end
    endfunction
    function [7:0] pmul_b;
        input [7:0] x;
        begin
            if (x[7])
                pmul_b = (x << 1) ^ x ^ 8'h1b;
            else
                pmul_b = (x << 1) ^ x;
