//aes_key_expand_128
module aes_key_expand_128(clk, kld, key, wo_0, wo_1, wo_2, wo_3) ;
  input          clk, kld;
  input  [127:0] key;
  output [31:0]  wo_0, wo_1, wo_2, wo_3;
  reg    [31:0]  w [0:3];
  wire   [31:0]  w_0, w_1, w_2, w_3;
  wire   [31:0]  rc;
  wire   [31:0]  w_0_t, w_1_t, w_2_t, w_3_t;
  wire   [7:0]   s0, s1, s2, s3;
  wire   [7:0]   s0_t, s1_t, s2_t, s3_t;
  wire   [7:0]   a0, a1, a2, a3;
  wire   [7:0]   a0_t, a1_t, a2_t, a3_t;
  wire   [31:0]  wo_0, wo_1, wo_2, wo_3;
  //round constant
  aes_rcon rcon(.clk(clk), .kld(kld), .out(rc));
  //key loading
  always @(posedge clk)
  begin
    if (kld)
    begin
      w[0] <= key[127:96];
      w[1] <= key[95:64];
      w[2] <= key[63:32];
      w[3] <= key[31:0];
    end
    else
    begin
      w[0] <= wo_0;
      w[1] <= wo_1;
      w[2] <= wo_2;
      w[3] <= wo_3;
    end
  end
  //key expansion
  assign w_0 = w[0];
  assign w_1 = w[1];
  assign w_2 = w[2];
  assign w_3 = w[3];
  assign a0 = w_0[31:24];
  assign a1 = w_0[23:16];
  assign a2 = w_0[15:8];
  assign a3 = w_0[7:0];
  assign s0 = w_1[31:24];
  assign s1 = w_1[23:16];
  assign s2 = w_1[15:8];
  assign s3 = w_1[7:0];
  assign a0_t = w_2[31:24];
  assign a1_t = w_2[23:16];
  assign a2_t = w_2[15:8];
  assign a3_t = w_2[7:0];
  assign s0_t = w_3[31:24];
  assign s1_t = w_3[23:16];
  assign s2_t = w_3[15:8];
  assign s3_t = w_3[7:0];
  assign w_0_t = {a1, a2, a3, a0} ^ {s1, s2, s3, s0} ^ rc;
  assign w_1_t = {a2, a3, a0, a1} ^ {s2, s3, s0, s1} ^ w_0;
  assign w_2_t = {a3, a0, a1, a2} ^ {s3, s0, s1, s2} ^ w_1;
  assign w_3_t = {a0, a1, a2, a3} ^ {s0, s1, s2, s3} ^ w_2;
  assign wo_0 = w_0_t;
  assign wo_1 = w_1_t;
  assign wo_2 = w_2_t;
  assign wo_3 = w_3_t;
endmodule

