wire    [31:0]  w0_next, w1_next, w2_next, w3_next;
wire    [31:0]  t0, t1, t2, t3;
wire    [7:0]   rcon;
wire    [31:0]  s0, s1, s2, s3;
reg     [7:0]   rcon_reg;
// 4-stage pipeline
always @(posedge clk)
begin
    w[0] <= w0_next;
    w[1] <= w1_next;
    w[2] <= w2_next;
    w[3] <= w3_next;
    rcon_reg <= rcon;
end
// first stage
assign w0_next = kld ? key[127:96] : w0;
assign w1_next = kld ? key[95:64] : w1;
assign w2_next = kld ? key[63:32] : w2;
assign w3_next = kld ? key[31:0] : w3;
// second stage
assign t0 = w[0] ^ {w[1][31:24], w[1][23:0]};
assign s0 = {t0[31:24], aes_sbox_inst0.a(t0[23:16]), aes_sbox_inst0.b(t0[15:8]), aes_sbox_inst0.c(t0[7:0])};
