assign s1 = {t1[31:24], aes_sbox_inst1.a(t1[23:16]), aes_sbox_inst1.b(t1[15:8]), aes_sbox_inst1.c(t1[7:0])};
assign t2 = w[2] ^ {w[3][31:24], w[3][23:0]};
assign s2 = {t2[31:24], aes_sbox_inst2.a(t2[23:16]), aes_sbox_inst2.b(t2[15:8]), aes_sbox_inst2.c(t2[7:0])};
assign t3 = w[3] ^ {w[0][31:24], w[0][23:0]};
assign s3 = {t3[31:24], aes_sbox_inst3.a(t3[23:16]), aes_sbox_inst3.b(t3[15:8]), aes_sbox_inst3.c(t3[7:0])};
