assign wo_0 = w[0] ^ s0 ^ {rcon_reg[7:0], 24'b0};
assign wo_1 = w[1] ^ s1;
assign wo_2 = w[2] ^ s2;
assign wo_3 = w[3] ^ s3;
// fourth stage
assign w0 = wo_0;
assign w1 = wo_1;
assign w2 = wo_2;
assign w3 = wo_3;
